import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ImageDetection from './Components/image_detection';

function App() {
  return (
  <>
<Router>
  <Routes>
    <Route path='/' element={<ImageDetection/>}/>
  </Routes>
</Router>
  </>
  );
}

export default App;
